eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"default\": () => (__WEBPACK_DEFAULT_EXPORT__)\n/* harmony export */ });\n// Module\nvar code = \"<hr>\\n<p>title: 학교로 돌아가기까지 한 주\\nsubTitle: 마지막 휴가일까?\\ndate: 2023-02-12</p>\\n<hr>\\n<h2 id=\\\"우테코가-끝나고\\\">우테코가 끝나고</h2>\\n<p>일 년 가까운 시간을 우테코에서 보내고, 이제는 우테코가 아닌 학생으로서 다시 학교로 돌아가게 되었다. 프론트와 백을 가리지 않고 많은 우테코 동기들이 취업을 하고, 사회로 나가는 반면 학교로 돌아가는 사람은 그리 많지만은 않았다. 처음에는 많은 것들이 낯설었다. 매주 일정을 정하고, 공부하며 개발하고, 회의하는 삶에서 벗어나 온전히 홀로 서게 된 느낌. 또는 그런 사람들 속에서 다시 학생이 된 내 모습이 맞지 않는 옷을 입은 듯 했다.</p>\\n<p>생활 습관도 관성이라고 했었는데, 그 말이 맞다는걸 증명이라도 하듯이 하루도 거르지 않고 크루들과 연락을 주고받았다. 다른 사람들보다 오래도록 마음의 준비를 했었는데도 내심 두려웠는지 나도 모르게 그 그룹을 벗어나지 않으려고 애를 썼던것 같다. 함께 공부하던 프론트엔드 동기 두 명과 사이드 프로젝트도 함께 시작하고, 이제는 갈 일이 없던 잠실과 선릉 (우테코 캠퍼스가 있는 곳이다.) 을 뺀질나게 왕래했다. 정이라는게 그리 쉽게 떨어지지 않을거란건 알지만서도 이럴때 보면 참 얄궂다.</p>\\n<h2 id=\\\"포비와의-상담\\\">포비와의 상담</h2>\\n<p>우테코를 수료하기 전, 캡틴이었던 포비와 상담을 진행했다. 표면적으로는 우테코를 나가서도 지금처럼 성장하며 공부할 수 있을지 잘 모르겠다는게 상담 이유였다. 사실은 불안했던 미래가 두려워 무슨 말이든 듣고 싶었던게 더 컸다. 나도 내가 어떤 말을 해야할지 제대로 정리되지 않았지만, 주변 크루들이 포비와 상담하고 크게 힐링을 받았다는 이야기를 들어온 터라 망설일 시간에 눈 딱 감고 무작정 신청했다.</p>\\n<p>아마 포비도 상담을 진행하러 온 내 얼굴을 보고 얼추 내 상태를 아셨던것 같다. 무엇을 해야할지 모르겠다는 말에 포비는 본인이 개발자라는 직업을 어떻게 갖게 되었고, 교육자로서 보내는 지금의 삶까지 오게 되었는지에 대해 이야기를 들려주셨다. 불안했던 미래에 대한 고민이나 걱정을 이겨냈던 선배 개발자의 존재와, 그 증거로 당장 눈 앞에 계신 열정적인 교육자의 모습이 그땐 어찌나 든든하게 느껴졌는지. 걱정으로 좁아졌던 시야가 탁 트이는 느낌이었다.</p>\\n<p>상담이 마무리 되어갈때쯤 하신 이야기가 아직도 기억에 남는다.</p>\\n<blockquote>\\n<p>지금이야 제가 이렇게 말씀드리고 상담해서 좀 괜찮아지셨겠지만, 이 문을 나가면 금방 또 돌아올거다.\\n불안함이나 걱정은 본인이 원래 갖고 있던 것이기 때문에 없앨 수는 없다. 다만 이겨내야 된다.</p>\\n</blockquote>\\n<p>그땐 정말 그럴 것 같다며, 나가면 다시 문 열고 들어와도 되냐고 너스레를 떨었는데 지금 다시 걱정이 찾아와서 이렇게 회고를 적고있는 걸 보면 이런게 인생 선배님의 조언인가 싶고 그렇다.</p>\\n<h2 id=\\\"돌아와서-그럼-지금은\\\">돌아와서, 그럼 지금은</h2>\\n<p>물론 내 불안감을 몰아내는데 많은 도움이 되었지만, 멘탈적인 상담만 한건 아니었다. 앞으로 개발과 동시에 교육에도 관심이 있던터라 이런 쪽의 경험이나 능력을 쌓으려면 어떻게 하면 좋을지 여쭤보았는데, 결국 돌고 돌아 답은 우테코였다.</p>\\n<blockquote>\\n<p>지금까지 진행해왔던 미션이나 시스템에 대해서도 잘 알고 있으니 나가서 후배들을 이끌고 본인이 받은 교육을 진행해보는게 어때요?\\n어차피 자료들도 다 외부에 공개되어 있으니 마음껏 활용해보세요.</p>\\n</blockquote>\\n<p>맞다. 내가 지금 가장 잘 할 수 있는게 그런거였다. 입버릇처럼 말하며 다녔었던 <strong>&quot;함께 자라기&quot;</strong> 를 이럴때 아니면 언제 써먹겠나 싶었다. 물론 실제로 진행한 교육을 후배들이 그대로 수행하기엔 어려울테니 난이도는 내가 임의로 조정해보자는 결론에 다다랐고, 그 결과가 지금 진행하고 있는 교내 학술 동아리 TCP의 <a href=\\\"https://github.com/TeamCrazyPerformance/front-todolist\\\">웹 프론트 스터디</a>이다.</p>\\n<p><img src=\\\"https://user-images.githubusercontent.com/28296575/218318107-9da92845-7ab6-4951-ad76-774526c9f22e.png\\\" alt=\\\"리뷰도 열심히 달아주고 있다\\\"></p>\\n<p>미션도 적당히 쉬우면서 공부할만한 주제를 포함하는 방향으로 새로 만들고, 6~7명 되는 인원들에게 모두 리뷰를 달아주고 피드백을 진행하고... 우테코에 한창 다닐때처럼 할 일은 많지만, 정말 포비의 말씀대로 내가 더 많이 배워가는 중이다. 힘들어도 리뷰에 대한 답변을 받을때면 정말 큰 뿌듯함을 느낀다.</p>\\n<p>여기에 추가로 매주 블로그 글을 쓰는 모임도 함께 진행중이다. 우테코 다닐때 크루들끼리 모여서 서로 글쓰기를 독려해주려 만들었던 모임인데, 효과가 좋아서 학생들을 대상으로도 하고 있다. 스스로를 자타가 공인하는 블로그 예찬론자라고 생각하기도 하고, 무엇보다 글써서 나쁠건 없으니까. 다들 작게나마 도움이 되길 바라면서 하고있다.</p>\\n<h2 id=\\\"이제-진짜-대학생으로-돌아갈-시간\\\">이제 진짜 대학생으로 돌아갈 시간</h2>\\n<p>이제 진짜 대학생이다. 다시 대학생이다. 실제로 다닐 기간만 1년 가량 남은 사실상 마지막 학년이지만, 졸업하기 전까지는 최대한 많은 것들을 알려주고 좋은 영향력을 끼칠 수 있는 선배가 되었으면 좋겠다. 그러면서 이뤄지는 내 성장은 덤이다. 본격적인 학기가 시작하고 나면 다시 회고를 쓰러 오겠지? 그때는 어떤 생각을 하고 있을지 궁금해진다. 안녕!</p>\\n<p><img src=\\\"https://user-images.githubusercontent.com/28296575/218318208-c97a290e-a00b-40c2-947d-57a88c470051.png\\\" alt=\\\"반갑다 동아리방\\\"></p>\\n\";\n// Exports\n/* harmony default export */ const __WEBPACK_DEFAULT_EXPORT__ = (code);//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(rsc)/./src/posts/5.md\n");

